			shellScript = "# move into include-dir of COLLADA_DOM\ncd ${SRCROOT}/../../include\n\nfor H in `find ./dae -name \"*.h\"`;  do\n    ditto ${H} ${BUILT_PRODUCTS_DIR}/${PUBLIC_HEADERS_FOLDER_PATH}/${H}\ndone\n\nfor H in `find ./modules -name \"*.h\"`;  do\n    ditto ${H} ${BUILT_PRODUCTS_DIR}/${PUBLIC_HEADERS_FOLDER_PATH}/${H}\ndone\n\n# We copy the 1.4 DOM-Headers only (and thus are able to flatten the header-hierarchie)\n\ncd ${SRCROOT}/../../include/1.4\n\n# only copy those headers residing in directories (for COLLADA_DOM141 skip 1.3 headers)\nfor H in `find ./ -name \"*.h\"`;  do\n    ditto ${H} ${BUILT_PRODUCTS_DIR}/${PUBLIC_HEADERS_FOLDER_PATH}/${H}\ndone";
